Let me think through this step by step...

**Key Psychological Mechanisms:**

1. **Fairness:** Responders likely consider the fairness of the offer relative to their contribution and the opponent's contribution.  A purely self-interested model would be insufficient here.  Inequity aversion is a key psychological principle.

2. **Relative Contribution:** The ratio of the responder's tokens to the opponent's tokens (`token_self/token_opp`) significantly influences the perception of fairness.  A larger ratio might lead to higher expectations of a larger share.

3. **Proportionate Share:** Responders may evaluate the offer not just in absolute terms (£), but also as a percentage of the total earnings (`split_perc_self`). This aligns with the concept of proportional fairness.


**How these Mechanisms Interact:**

The perception of fairness is a function of both the absolute amount offered (`split_self`) and its proportion to the total earnings (`split_perc_self`), modulated by the relative contribution of tokens.  A small absolute share might be acceptable if the relative contribution is also small, and vice-versa.  A model needs to capture this interaction.

**Mathematical Form:**

A multiplicative model can capture the interaction between these factors.  We can combine the effect of the absolute share and the proportional share, weighted by the relative contribution.

**Parameters:**

1. `fairness_weight`: This parameter represents the importance of fairness to the responder. Higher values indicate a stronger preference for fairness.  A value near zero indicates pure self-interest.  This will be applied to the absolute share.
2. `proportion_weight`: This parameter scales the importance of proportional fairness. A higher value implies stronger preference for receiving a share proportional to one's contribution.  This will be applied to the proportional share.


**How Model Variables Map to Observable Behavior:**

The model calculates a utility score. A higher utility score implies a greater likelihood of acceptance.  The model only focuses on acceptance behavior.

<MODEL>
U = fairness_weight * split_self + proportion_weight * (split_perc_self * (token_self / (token_self + token_opp)) )
</MODEL>

